import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import './header.css';
import App from './App';
// import Header from './Header';
import Logo from './Logo';
import Card from './Card';
import Footer from './Footer';
import Utilities from './Utilities';
import Nav from './Nav';
import NavLink from './NavLink';
import reportWebVitals from './reportWebVitals';

ReactDOM.render(
  <React.StrictMode>
    <App />
    {/* <Header /> */}

    <Card headingLevel='h2'>
      title = {'This is a test title'} {description = 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.'}</Card>

    {/* <Footer headingLevel='h2'> */}

    {/* </Footer> */}


  </React.StrictMode >,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
